import './App.css';

function App() {

  let [name, setName] = useState('Oscar');

  const changeName = () => {
   setName('Simon')
  }

  return (
    <div className="App">
      <h1>{name}</h1>
      <button onClick={changeName}>Change name</button>
    </div>
  );
}

export default App;
